#include <iostream>
#include <vector>
#include <queue>
#include <unordered_map>
#include <map>
#include <stack>
#include <cmath>
#include <algorithm>

using namespace std;

class Solution {
public:
    int findKthPositive(vector<int>& arr, int k) {
        int size = (int)arr.size();
        if (size == 0) return k;
        vector<int> memory(2001, 0);
        memory[0] = 1;
        for (auto num : arr) memory[num] += 1;
        int count = 0;
        for (int i = 1; i < 1001; ++i) {
            if (memory[i] == 0) count++;
            if (count == k) return i;
        }
        return -1;
    }
    // 计算切换次数，即为两字母的偏移值
    int getBias(char a, char b) {
        int bias = b - a;
        return bias >= 0 ? bias : bias+26;
    }
    bool canConvertString(string s, string t, int k) {
        int s_len = (int)s.length();
        int t_len = (int)t.length();
        if (s_len != t_len) return false;
        
        // 用来记忆 [1, 25] 中的偏移值命中次数
        vector<int> memory(26, false);
        for (int j = 0; j < s_len; j++) {
            int bias = getBias(s[j], t[j]);
            if (bias == 0) continue;
            if (bias > k) return false;
            int temp = ++memory[bias];
            // 首次命中只需切换 bias 次，第 n 次命中需要切换 (n-1)*26 + bias 次
            if (temp > 1 && (temp-1)*26+bias > k) return false;
        }
        return true;
    }
    
    int minInsertions(string s) {
        int len = (int)s.length();
        int l, r;
        int left, right;
        left = right = 0;
        l = r = 0;
        int result = 0;
        for (int i = 0; i < len; i++) {
            if (s[i] == '(') {
                l += 1;
                if(l > 1) {
                    l = 1;
                    result += 2-r;
                }
                r = 0;
            }
            if (s[i] == ')') r++;
            if (r == 2) {
                l--;
                if (l < 0) {
                    result += 1;
                    l = 0;
                }
                r = 0;
            }
        }
        if (r == 1) {
            l -= 1;
            r += 1;
        }

        if (l > 0) result += l*2 + r/2;
        else result += abs(l) + r/2;
        return result;
    }
    
};



